Interessante o fato que na eleição de 2000, George Bush foi eleito graças a uma vergonhosa fraude fartamente documentada no estado da Florida, onde o voto é em papel e a apuração demorou mais de um mês.
Não cite, portanto, os EUA. Eles não são bom exemplo.

